import { createAsyncThunk } from "@reduxjs/toolkit";



const fetchUserPage2 = createAsyncThunk("userPage2/getListUsers", () => {
    fetch("https://reqres.in/api/users?page=2").then((res) => {
        console.log("response: ", res);
    });
});
